    return (
        <div className={styles.wrapper}>
            <div className={styles.left}>
                <div className={styles.name}>Hi, I'm Asif Tanvir</div>
                <div className="info"> - 2nd Year B.Tech Student at IIEST, Shibpur</div>
                <div className="info_main">Just a teenager who likes tinkering with stuff, hence my interest in Linux. I
                    enjoy writing C++ code, Python too. Maybe a bit of bash scripting, but I'm not great at it. Oh, and
                    ricing my desktop—I like that too. :p</div>
                <div className="dash"></div>
                <div className="socials">
                    󰌻 󰊤
                </div>
            </div>
        </div>

    )
}
export default Intro;
